import "./App.css";
import React, { useState, useEffect } from "react";
import ProductList from "./ProductList/productList";
function App() {
  const url = "http://localhost:3001/products/all/";
  const [data, setData] = useState([]);

  const fetchInfo = () => {
    return fetch(url)
      .then((res) => res.json())
      .then((d) => setData(d))
  }


  useEffect(() => {
    fetchInfo();
  }, []);

  return (
    <div className="App">


      <ProductList/>
    </div>
  );
}

export default App;
